//SPDX-License-Identifier: MIT

pragma solidity ^0.8.24;

library EcosystemLib {
    struct Data {
        uint256 nextCourseId;
        uint256 nextChapterId;
        uint256 nextLessonId;
        uint256 nextQuizId;
        uint256 nextQuestionId;
        uint256 nextChoiceId;
    }

    function initialize(Data storage self) internal {
        self.nextCourseId = 1;
        self.nextChapterId = 1;
        self.nextLessonId = 1;
        self.nextQuizId = 1;
        self.nextQuestionId = 1;
        self.nextChoiceId = 1;
    }
}

contracts/DiamondProxy/DiamondLibrary/Li.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "../DiamondInterfaces/IDiamondCut.sol";
import "./EcosystemLib.sol";

error NoSelectorsProvidedForFacetForCut(address _facetAddress);
error IncorrectFacetCutAction(uint8 _action);
error CannotReplaceFunctionWithTheSameFunctionFromTheSameFacet(bytes4 _selector);
error CannotReplaceFunctionsFromFacetWithZeroAddress(bytes4[] _selectors);
error CannotReplaceImmutableFunction(bytes4 _selector);
error CannotReplaceFunctionThatDoesNotExists(bytes4 _selector);
error RemoveFacetAddressMustBeZeroAddress(address _facetAddress);
error CannotRemoveFunctionThatDoesNotExist(bytes4 _selector);
error CannotRemoveImmutableFunction(bytes4 _selector);

library LibDiamond {
    bytes32 constant DIAMOND_STORAGE_POSITION = keccak256("diamond.standard.diamond.storage");
    bytes32 constant ECOSYSTEM_STORAGE_POSITION = keccak256("ecosystem.base.storage");
    bytes32 constant ECOSYSTEM2_STORAGE_POSITION = keccak256("ecosystem2.base.storage");
    bytes32 constant ECOSYSTEM3_STORAGE_POSITION = keccak256("ecosystem3.base.storage");
    bytes32 constant ECOSYSTEM_DATA_STORAGE_POSITION = keccak256("diamond.ecosystem.data.storage");
    bytes32 constant REVIEWER_ROLE = keccak256("REVIEWER_ROLE");
    bytes32 constant COURSE_OWNER_ROLE = keccak256("COURSE_OWNER_ROLE");

    uint256 public constant MAX_SUPPLY = 10000000000 * 10 ** 18;
    uint256 public constant ECOSYSTEM_POOL = (MAX_SUPPLY * 15) / 100;
    uint256 public constant CREATE_COURSE_REWARD = 5 * 10 ** 18;
    uint256 public constant ENROLLMENT_REWARD = 2 * 10 ** 18;
    uint256 public constant REQUIRED_APPROVALS = 2;
    uint256 public constant MAX_SCORE = 100;
    uint256 public constant MIN_APPROVAL_SCORE = 80;
    uint256 public constant COURSE_COMPLETION_REWARD = 2 * 10 ** 18;
    uint256 public constant QUIZ_COMPLETION_REWARD = 1 * 10 ** 18;

    struct FacetAddressAndPosition {
        address facetAddress;
        uint96 functionSelectorPosition;
    }

    struct FacetFunctionSelectors {
        bytes4[] functionSelectors; // Array of function selectors
    }

     struct FacetAddressAndSelectorPosition {
        address facetAddress;
        uint16 selectorPosition;
    }

    struct DiamondStorage {
        mapping(bytes4 => address) facets;
        address owner;
         bytes4[] selectors;
        address[] facetAddresses;
        mapping(address => bool) authorizedFacets;
        mapping(address => FacetFunctionSelectors) facetFunctionSelectors;
        mapping(bytes4 => FacetAddressAndSelectorPosition) facetAddressAndSelectorPosition;
        mapping(bytes4 => FacetAddressAndPosition) selectorToFacetAndPosition; // Ensure this line is correctly placed
        mapping(address => uint256) facetAddressPosition; // Added this line
        mapping(address => bytes4[]) facetToSelectors; // Added this line
        mapping(bytes4 => bool) supportedInterfaces; // Added this line
    }

    //Struct to Hold EcosystemLib.Data
    struct EcosystemDataStorage {
        EcosystemLib.Data data;
    }

    //Ecosystem1Facet Storage
    struct EcosystemStorage {
        uint256 ecosystemPoolSupply;
        uint256 courseCount;
        uint256 nextCourseId;
        address[] reviewerPool;
        mapping(address => bool) isInReviewerPool;

        mapping(uint256 => Course) courseObject;
        mapping(uint256 => mapping(address => Review)) reviews;
        mapping(address => Account) accountCourses;
        mapping(uint256 => mapping(address => bool)) approvals;
        mapping(uint256 => Course) courses;
        mapping(uint256 => Review[]) courseReviews;
        mapping(uint256 => address[]) courseReviewers;
        mapping(address => uint256[]) userCourses;
        mapping(uint256 => mapping(address => bool)) courseApprovals;

        Course[] listOfCourses;
    }

    //Ecosystem2Facet Storage
    struct Ecosystem2Storage {
        mapping(uint256 => mapping(address => bool)) lessonRead;
        mapping(address => uint256[]) userCompletedLessons;
        mapping(address => mapping(uint256 => uint256[])) userCompletedLessonsByCourse;
        mapping(uint256 => Chapter) chapter;
        mapping(uint256 => Chapter[]) courseChapters;
        mapping(uint256 => Lesson) lesson;
        mapping(uint256 => string[]) chapterLessons;
        mapping(uint256 => Quiz) quizzes;
        mapping(uint256 => Question) questions;
        mapping(uint256 => mapping(address => bool)) isEnrolled;
        mapping(uint256 => mapping(address => bool)) completedQuizzes;
        mapping(address => mapping(uint256 => uint256)) userScores;

        Course[] listOfCourses;
        Chapter[] listOfChapters;
        Lesson[] listOfLessons;
        Resource[] listOfResources;
        Quiz[] listOfQuizzes;
        Question[] listOfQuestions;
        Choice[] listOfChoices;
    }

    struct Course {
        uint256 courseId;
        string courseName;
        string description;
        bool approved;
        uint256 approvalCount;
        address creator;
        bool exists;
        address[] enrolledStudents;
        DifficultyLevel difficultyLevel;
    }

    enum DifficultyLevel { Beginner, Intermediate, Advanced }

    struct Review {
        uint256 learnerAgency;
        uint256 criticalThinking;
        uint256 collaborativeLearning;
        uint256 reflectivePractice;
        uint256 adaptiveLearning;
        uint256 authenticLearning;
        uint256 technologyIntegration;
        uint256 learnerSupport;
        uint256 assessmentForLearning;
        uint256 engagementAndMotivation;
        bool isSubmitted;
    }

    struct Account {
        uint256 courseCount;
    }

    struct Chapter {
        uint256 courseId;
        uint256 chapterId;
        string chapterName;
        uint256 duration; // Duration in weeks
        bool exists;
    }

    struct Lesson {
        uint256 chapterId;
        uint256 lessonId;
        string lessonName;
        string lessonContent;
        Resource[10] additionalResources;
        uint256 resourceCount;
        bool exists;
    }

    enum ContentType { Video, Image, Document }

    struct Resource {
        ContentType contentType;
        string url;
        string name;
    }

    struct Quiz {
        uint256 lessonId;
        uint256 quizId;
        string quizTitle;
        Question[] questions;
        bool exists;
    }

    struct Question {
        uint256 quizId;
        uint256 questionId;
        string questionText;
        Choice[] choices;
    }

    struct Choice {
        string option;
        bool isCorrect;
    }

    //Ecosystem3Facet Storage
    struct Ecosystem3Storage {
        mapping(uint256 => mapping(address => bool)) courseCompleted;
        mapping(address => mapping(uint256 => uint256)) userScores;
        mapping(uint256 => mapping(address => bool)) completedQuizzes;
        mapping(uint256 => Certificate) certificates;

        Certificate[] listOfCertificates;
    }

    struct Certificate {
        uint256 certId;
        uint256 courseId;
        string learner;
        string cert_issuer;
        uint issue_date;
        string courseName;
        address owner;
    }

function diamondStorage() internal pure returns (DiamondStorage storage ds) {
    bytes32 position = DIAMOND_STORAGE_POSITION;
    assembly {
        ds.slot := position
    }
}


    function ecosystemStorage() internal pure returns (EcosystemStorage storage es) {
        bytes32 position = ECOSYSTEM_STORAGE_POSITION;
        assembly {
            es.slot := position
        }
    }

    function ecosystem2Storage() internal pure returns (Ecosystem2Storage storage es) {
        bytes32 position = ECOSYSTEM2_STORAGE_POSITION;
        assembly {
            es.slot := position
        }
    }

    function ecosystem3Storage() internal pure returns (Ecosystem3Storage storage es) {
        bytes32 position = ECOSYSTEM3_STORAGE_POSITION;
        assembly {
            es.slot := position
        }
    }

    function ecosystemDataStorage() internal pure returns (EcosystemDataStorage storage eds) { 
        bytes32 position = ECOSYSTEM_DATA_STORAGE_POSITION;
        assembly {
            eds.slot := position
        }
    }

    function initializeEcosystemData() internal {
        EcosystemDataStorage storage eds = ecosystemDataStorage();
        EcosystemLib.initialize(eds.data); // Call EcosystemLib's initialize function
    }

    function enforceIsContractOwner() internal view {
        require(msg.sender == diamondStorage().owner, "LibDiamond: Must be contract owner");
    }

    function setContractOwner(address _newOwner) internal {
        DiamondStorage storage ds = diamondStorage();
        ds.owner = _newOwner;
    }

     // Helper function to get reviewerPool length
    function getReviewerPoolLength() internal view returns (uint256) {
        return ecosystemStorage().reviewerPool.length;
    }

    // Helper function to check if address is in reviewer pool
    function isInReviewerPool(address reviewer) internal view returns (bool) {
        return ecosystemStorage().isInReviewerPool[reviewer];
    }

     function diamondCut(
        IDiamondCut.FacetCut[] memory _diamondCut,
        address _init,
        bytes memory _calldata
    ) internal {
        for (uint256 facetIndex; facetIndex < _diamondCut.length; facetIndex++) {
            bytes4[] memory functionSelectors = _diamondCut[facetIndex].functionSelectors;
            address facetAddress = _diamondCut[facetIndex].facetAddress;
            if(functionSelectors.length == 0) {
                revert NoSelectorsProvidedForFacetForCut(facetAddress);
            }
            IDiamondCut.FacetCutAction action = _diamondCut[facetIndex].action;
            if (action == IDiamondCut.FacetCutAction.Add) {
                addFunctions(facetAddress, functionSelectors);
            } else if (action == IDiamondCut.FacetCutAction.Replace) {
                replaceFunctions(facetAddress, functionSelectors);
            } else if (action == IDiamondCut.FacetCutAction.Remove) {
                removeFunctions(facetAddress, functionSelectors);
            } else {
                revert IncorrectFacetCutAction(uint8(action));
            }
        }
        emit IDiamondCut.DiamondCut(_diamondCut, _init, _calldata);
        initializeDiamondCut(_init, _calldata);
    }

    function addFunctions(address _facetAddress, bytes4[] memory _functionSelectors) internal {
        require(_functionSelectors.length > 0, "LibDiamondCut: No selectors in facet to cut");
        DiamondStorage storage ds = diamondStorage();
        require(_facetAddress != address(0), "LibDiamondCut: Add facet can't be address(0)");
        uint96 selectorPosition = uint96(ds.facetFunctionSelectors[_facetAddress].functionSelectors.length);
        if (selectorPosition == 0) {
            addFacet(_facetAddress);
        }
        for (uint256 selectorIndex; selectorIndex < _functionSelectors.length; selectorIndex++) {
            bytes4 selector = _functionSelectors[selectorIndex];
            address oldFacetAddress = ds.selectorToFacetAndPosition[selector].facetAddress;
            require(oldFacetAddress == address(0), "LibDiamondCut: Can't add function that already exists");
            ds.selectorToFacetAndPosition[selector].facetAddress = _facetAddress;
            ds.selectorToFacetAndPosition[selector].functionSelectorPosition = selectorPosition;
            ds.facetFunctionSelectors[_facetAddress].functionSelectors.push(selector);
            ds.facetToSelectors[_facetAddress].push(selector); // Add this line to update facetToSelectors
            selectorPosition++;
        }
    }

    function replaceFunctions(address _facetAddress, bytes4[] memory _functionSelectors) internal {        
        DiamondStorage storage ds = diamondStorage();
        if(_facetAddress == address(0)) {
            revert CannotReplaceFunctionsFromFacetWithZeroAddress(_functionSelectors);
        }
        enforceHasContractCode(_facetAddress, "LibDiamondCut: Replace facet has no code");
        for (uint256 selectorIndex; selectorIndex < _functionSelectors.length; selectorIndex++) {
            bytes4 selector = _functionSelectors[selectorIndex];
            address oldFacetAddress = ds.facetAddressAndSelectorPosition[selector].facetAddress;
            // can't replace immutable functions -- functions defined directly in the diamond in this case
            if(oldFacetAddress == address(this)) {
                revert CannotReplaceImmutableFunction(selector);
            }
            if(oldFacetAddress == _facetAddress) {
                revert CannotReplaceFunctionWithTheSameFunctionFromTheSameFacet(selector);
            }
            if(oldFacetAddress == address(0)) {
                revert CannotReplaceFunctionThatDoesNotExists(selector);
            }
            // replace old facet address
            ds.facetAddressAndSelectorPosition[selector].facetAddress = _facetAddress;
        }
    }

    function addFacet(address _facetAddress) internal {
        DiamondStorage storage ds = diamondStorage();
        enforceHasContractCode(_facetAddress, "LibDiamondCut: New facet has no code");
        ds.facetAddresses.push(_facetAddress);
        ds.authorizedFacets[_facetAddress] = true;
    }

    function removeFunctions(address _facetAddress, bytes4[] memory _functionSelectors) internal {        
        DiamondStorage storage ds = diamondStorage();
        uint256 selectorCount = ds.selectors.length;
        if(_facetAddress != address(0)) {
            revert RemoveFacetAddressMustBeZeroAddress(_facetAddress);
        }        
        for (uint256 selectorIndex; selectorIndex < _functionSelectors.length; selectorIndex++) {
            bytes4 selector = _functionSelectors[selectorIndex];
            FacetAddressAndSelectorPosition memory oldFacetAddressAndSelectorPosition = ds.facetAddressAndSelectorPosition[selector];
            if(oldFacetAddressAndSelectorPosition.facetAddress == address(0)) {
                revert CannotRemoveFunctionThatDoesNotExist(selector);
            }


            // can't remove immutable functions -- functions defined directly in the diamond
            if(oldFacetAddressAndSelectorPosition.facetAddress == address(this)) {
                revert CannotRemoveImmutableFunction(selector);
            }
            // replace selector with last selector
            selectorCount--;
            if (oldFacetAddressAndSelectorPosition.selectorPosition != selectorCount) {
                bytes4 lastSelector = ds.selectors[selectorCount];
                ds.selectors[oldFacetAddressAndSelectorPosition.selectorPosition] = lastSelector;
                ds.facetAddressAndSelectorPosition[lastSelector].selectorPosition = oldFacetAddressAndSelectorPosition.selectorPosition;
            }
            // delete last selector
            ds.selectors.pop();
            delete ds.facetAddressAndSelectorPosition[selector];
        }
    }

    function initializeDiamondCut(address _init, bytes memory _calldata) internal {
        if (_init == address(0)) {
            require(_calldata.length == 0, "LibDiamondCut: _init is address(0) but_calldata is not empty");
        } else {
            require(_calldata.length > 0, "LibDiamondCut: _calldata is empty but _init is not address(0)");
            if (_init != address(this)) {
                enforceHasContractCode(_init, "LibDiamondCut: _init address has no code");
            }
            (bool success, bytes memory error) = _init.delegatecall(_calldata);
            if (!success) {
                if (error.length > 0) {
                    // bubble up the error
                    assembly {
                        let returndata_size := mload(error)
                        revert(add(32, error), returndata_size)
                    }
                } else {
                    revert("LibDiamondCut: _init function reverted");
                }
            }
        }
    }

    function enforceHasContractCode(address _contract, string memory _errorMessage) internal view {
        uint256 contractSize;
        assembly {
            contractSize := extcodesize(_contract)
        }
        require(contractSize > 0, _errorMessage);
    }
}

contracts/DiamondProxy/Ecosystem1Facet.s.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.24;

import { LibDiamond } from "./DiamondLibrary/LibDiamond.sol";
import { EcosystemLib } from "./DiamondLibrary/EcosystemLib.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";


contract Ecosystem1Facet is ReentrancyGuard, AccessControl {
    using EcosystemLib for EcosystemLib.Data;
    EcosystemLib.Data private data;
    LibDiamond.DiamondStorage private diamondStorage;
    ReentrancyGuard private reentrancyGuard;

    bytes32 public constant COURSE_OWNER_ROLE = keccak256("COURSE_OWNER_ROLE");


    // Events
    event CourseCreationSuccess(uint256 indexed _courseID, string indexed _courseName, bool _approved);
    event EcosystemPoolUpdate(address indexed _to, uint256 indexed _amount);
    event CourseCreated(uint256 indexed courseId, string courseName, address creator);
    event CourseApproved(uint256 indexed courseId, uint256 approvalCount);
    event ReviewSubmitted(uint256 indexed courseId, address reviewer);
    event ReviewersAssigned(uint256 indexed courseId, address[] reviewers);
    event CourseEdited(uint256 indexed _courseId, string _courseName);
    event CourseDeleteSuccess(uint256 indexed _courseId, address owner);

    //Ecosystem1Facet Storage Pointer
    function ecosystemStorage() internal pure returns (LibDiamond.EcosystemStorage storage es) {
        return LibDiamond.ecosystemStorage();
    }


    function createCourse(string memory _courseName, string memory _description, LibDiamond.DifficultyLevel _difficultyLevel) external returns(bool) {
        LibDiamond.EcosystemStorage storage es = LibDiamond.ecosystemStorage();

        require(!es.courseObject[es.nextCourseId].exists, "Course already exists");

        LibDiamond.Course memory newCourse = LibDiamond.Course(
            es.nextCourseId, 
            _courseName, 
            _description, 
            false, 
            0, 
            msg.sender, 
            true, 
            new address[](0), 
            _difficultyLevel
        );

        es.courseObject[es.nextCourseId] = newCourse;
        es.listOfCourses.push(newCourse);

        es.courseCount++;
        es.accountCourses[msg.sender].courseCount += 1;
        es.nextCourseId++;

        // TODO: Implement role granting mechanism
        _grantRole(COURSE_OWNER_ROLE, msg.sender);

        emit CourseCreationSuccess(es.nextCourseId - 1, _courseName, false);

        return true;
    }

    function getAllCourses() external view returns (LibDiamond.Course[] memory) {
        LibDiamond.EcosystemStorage storage es = LibDiamond.ecosystemStorage();
        LibDiamond.Course[] memory courses = new LibDiamond.Course[](es.listOfCourses.length);

        for (uint i = 0; i < es.listOfCourses.length; i++) {
            courses[i] = LibDiamond.Course(
                es.listOfCourses[i].courseId,
                es.listOfCourses[i].courseName,
                es.listOfCourses[i].description,
                es.listOfCourses[i].approved,
                es.listOfCourses[i].approvalCount,
                es.listOfCourses[i].creator,
                es.listOfCourses[i].exists,
                es.listOfCourses[i].enrolledStudents,
                es.listOfCourses[i].difficultyLevel
            );
        }
        return courses;
    }

    // Token Minting and Burning Functions
    function mintToken(address to, uint256 amount) internal returns(bool) {
        LibDiamond.EcosystemStorage storage es = LibDiamond.ecosystemStorage();

        require(amount + es.ecosystemPoolSupply <= LibDiamond.ECOSYSTEM_POOL, "Limit Exceeded!");

        // TODO: Implement actual token minting logic
        mintToken(to, amount);

        es.ecosystemPoolSupply += amount;

        emit EcosystemPoolUpdate(to, amount);

        return true;
    }

    function burn(address account, uint256 amount) internal {
        LibDiamond.EcosystemStorage storage es = LibDiamond.ecosystemStorage();

        burn(account, amount);

        es.ecosystemPoolSupply -= amount;
    }

    function getCurrentEcosystemPoolSupply() public view returns(uint256) {
        LibDiamond.EcosystemStorage storage es = LibDiamond.ecosystemStorage();
        return es.ecosystemPoolSupply;
    }


function submitReview(uint256 courseId, uint256[10] memory scores) public onlyRole(LibDiamond.REVIEWER_ROLE) {
    LibDiamond.EcosystemStorage storage es = LibDiamond.ecosystemStorage();

    require(isReviewer(courseId, msg.sender), "Not a reviewer for this course");
    require(scores.length == 10, "Scores array must have 10 elements");

    validateScores(scores[0], scores[1], scores[2], scores[3], scores[4], 
                   scores[5], scores[6], scores[7], scores[8], scores[9]);

    // Create the review directly in storage
    LibDiamond.Review storage newReview = es.courseReviews[courseId].push();
    newReview.learnerAgency = scores[0];
    newReview.criticalThinking = scores[1];
    newReview.collaborativeLearning = scores[2];
    newReview.reflectivePractice = scores[3];
    newReview.adaptiveLearning = scores[4];
    newReview.authenticLearning = scores[5];
    newReview.technologyIntegration = scores[6];
    newReview.learnerSupport = scores[7];
    newReview.assessmentForLearning = scores[8];
    newReview.engagementAndMotivation = scores[9];
    newReview.isSubmitted = true;

    emit ReviewSubmitted(courseId, msg.sender);

    if (getTotalScore(newReview) >= LibDiamond.MIN_APPROVAL_SCORE) {
        approveCourse(courseId);
    }
}


    function validateScores(uint256 learnerAgency,uint256 criticalThinking,uint256 collaborativeLearning,uint256 reflectivePractice,uint256 adaptiveLearning,
        uint256 authenticLearning,uint256 technologyIntegration,uint256 learnerSupport,uint256 assessmentForLearning,uint256 engagementAndMotivation
        ) internal pure {
        require(
            learnerAgency <= 10 && criticalThinking <= 10 && collaborativeLearning <= 10 && reflectivePractice <= 10 &&
            adaptiveLearning <= 10 && authenticLearning <= 10 && technologyIntegration <= 10 &&
            learnerSupport <= 10 && assessmentForLearning <= 10 && engagementAndMotivation <= 10,
            "Scores must be between 1 and 10."
        );
    } 

    function getTotalScore(LibDiamond.Review storage review) internal view returns (uint256) {
        return review.learnerAgency + review.criticalThinking + review.collaborativeLearning + review.reflectivePractice + 
               review.adaptiveLearning + review.authenticLearning + review.technologyIntegration + review.learnerSupport + 
               review.assessmentForLearning + review.engagementAndMotivation;
    }

function isReviewer(uint256 courseId, address reviewer) internal view returns (bool) {
    LibDiamond.EcosystemStorage storage es = LibDiamond.ecosystemStorage();
    address[] storage reviewers = es.courseReviewers[courseId];

    for (uint256 i = 0; i < reviewers.length; i++) {
        if (reviewers[i] == reviewer) {
            return true;
        }
    }
    return false;
}

function selectCourseReviewers(uint256 courseId) public onlyRole(COURSE_OWNER_ROLE) {
    LibDiamond.EcosystemStorage storage es = LibDiamond.ecosystemStorage();

    require(es.courseReviewers[courseId].length == 0, "Reviewers already selected");
    require(es.reviewerPool.length >= 3, "Not enough reviewers in the pool");

    for (uint256 i = 0; i < 3; i++) {
        uint256 randomIndex = uint256(
            keccak256(
                abi.encodePacked(
                    block.timestamp, 
                    block.prevrandao, 
                    es.reviewerPool.length, 
                    i
                )
            )
        ) % es.reviewerPool.length;

        address selectedReviewer = es.reviewerPool[randomIndex];

        bool alreadySelected = false;
        for (uint256 j = 0; j < es.courseReviewers[courseId].length; j++) {
            if (es.courseReviewers[courseId][j] == selectedReviewer) {
                alreadySelected = true;
                break;
            }
        }

        if (!alreadySelected) {
            es.courseReviewers[courseId].push(selectedReviewer);
        }
    }

    emit ReviewersAssigned(courseId, es.courseReviewers[courseId]);
}

function approveCourse(uint256 courseId) public onlyRole(LibDiamond.REVIEWER_ROLE) {
    LibDiamond.EcosystemStorage storage es = LibDiamond.ecosystemStorage();

    LibDiamond.Course storage course = es.courses[courseId];
    require(!course.approved, "Course already approved");
    require(!es.courseApprovals[courseId][msg.sender], "Already approved");

    es.courseApprovals[courseId][msg.sender] = true;
    course.approvalCount++;

    if (course.approvalCount >= LibDiamond.REQUIRED_APPROVALS) {
        course.approved = true;

        emit CourseApproved(courseId, course.approvalCount);
        mintToken(course.creator, LibDiamond.CREATE_COURSE_REWARD);
    }
}

function getCourseReviewers(uint256 courseId) public view returns (address[] memory) {
    LibDiamond.EcosystemStorage storage es = LibDiamond.ecosystemStorage();
    return es.courseReviewers[courseId];
}

    //function to edit course
    function editCourse(uint256 _courseId, string memory _courseName) external onlyRole(COURSE_OWNER_ROLE) returns(bool) {
        LibDiamond.EcosystemStorage storage es = LibDiamond.ecosystemStorage();

        require(es.courseObject[_courseId].courseId != 0, "Course does not exist");
        es.courseObject[_courseId].courseName = _courseName;

        emit CourseEdited(_courseId, _courseName);

        return true;
    }

    //function to delete a course
    function deleteCourse(uint256 _courseId) external onlyRole(COURSE_OWNER_ROLE) returns(bool) {
        LibDiamond.EcosystemStorage storage es = LibDiamond.ecosystemStorage();

        require(es.courseObject[_courseId].courseId != 0, "Course doesn't exist!");

        for(uint256 i = 0; i <= es.listOfCourses.length; i++) {
            if(es.listOfCourses[i].courseId == _courseId) {
                es.listOfCourses[i] = es.listOfCourses[es.listOfCourses.length - 1];
                es.listOfCourses.pop();
            }

        }

        delete(es.courseObject[_courseId]);

        emit CourseDeleteSuccess(_courseId, msg.sender);

        return true;
    }
}

